    axios.get('https://jsonplaceholder.typicode.com/todos')
    .then((res) => {
      const todos = res.data
      console.log(todos)
      setFetchTodos(todos);
    })
  }, [])

  const display = () => {
    <ul>{fetchTodo.title}</ul>
  }

  return (
    <div>
      <button onClick={display}>Fetch TODOS</button>
      {
        todos.map(todo => console.log(todo.title))
      }
    </div>
  )
}

